import{o as e,c as t,a as i}from"./app.5ec22dad.js";const a='{"title":"Git","description":"","frontmatter":{},"headers":[{"level":2,"title":"Git\'i materjalid","slug":"git-i-materjalid"},{"level":3,"title":"git\'i cheat sheet:","slug":"git-i-cheat-sheet"},{"level":3,"title":"Juhend oma arvutist giti tegemiseks","slug":"juhend-oma-arvutist-giti-tegemiseks"}],"relativePath":"github/index.md","lastUpdated":1616156540158}',r={},o=i('<h1 id="git"><a class="header-anchor" href="#git" aria-hidden="true">#</a> Git</h1><p><code>Alt+M</code> VS Code&#39;s kirjutamise abiks kui on installitud docs-amrkdown plugin<br><code>Shift+CMD+V</code> lülitab sisse MD preview<br> Markdown&#39;i juhend:<br><a href="https://www.markdownguide.org/basic-syntax/" target="_blank" rel="noopener noreferrer">https://www.markdownguide.org/basic-syntax/</a></p><h2 id="git-i-materjalid"><a class="header-anchor" href="#git-i-materjalid" aria-hidden="true">#</a> Git&#39;i materjalid</h2><h3 id="git-i-cheat-sheet"><a class="header-anchor" href="#git-i-cheat-sheet" aria-hidden="true">#</a> git&#39;i cheat sheet:</h3><p><a href="https://gist.github.com/webbj74/3788509" target="_blank" rel="noopener noreferrer">https://gist.github.com/webbj74/3788509</a><br><a href="https://education.github.com/git-cheat-sheet-education.pdf" target="_blank" rel="noopener noreferrer">https://education.github.com/git-cheat-sheet-education.pdf</a></p><p>GIT Cheat sheet: <a href="materials/git-cheatsheet-EN-dark.pdf">Download PDF</a>.</p><p>GIT&#39;i vahendeid: <a href="https://education.github.com/" target="_blank" rel="noopener noreferrer">https://education.github.com/</a></p><p>GIT&#39;i seletused ja õpe: <a href="https://www.gitkraken.com/learn/git/branch" target="_blank" rel="noopener noreferrer">https://www.gitkraken.com/learn/git/branch</a></p><p><strong>git origin on remote originaal</strong><br><strong>Git HEAD – only one branch can be checked out at a time - and this is what&#39;s called the &quot;HEAD&quot; branch. Often, this is also referred to as the &quot;active&quot; or &quot;current&quot; branch.</strong></p><ul><li><code>git init</code> - initsialiseerib giti folderis, kus asud</li><li><code>git status</code> - nagu nimi ütleb</li><li><code>git add .</code> (või kui spetsiifiline fail siis selle nimi) lisad muudatused</li><li><code>git commit -m &quot;Siia commit&quot;</code> ütled, mis muudatused tegid</li><li>add ja commit koos: <code>git commit -a -m &quot;siia commit&quot;</code></li><li><code>git log</code> - pmst ajalugu</li><li><code>git checkout commit...</code> taastab vastava commiti aegse seisu</li><li><code>git remote -v</code>näitab git remote originid</li><li><code>git branch</code> - näitab kõiki oksi</li><li><code>git checkout &lt;UUSHARU&gt;</code> liigub vastavasse harusse</li><li><code>git checkout -b &lt;UUSHARU&gt;</code> teeb haru ja liigub sellesse</li><li><code>git branch &lt;UUSHARU&gt;</code></li><li><code>git merge &lt;UUSHARU&gt;</code> (pead olema kuskil ja siis sinna liidad UUSHARU)</li><li><code>git branch -d &lt;UUSHARU&gt;</code> (-d delete)</li><li><code>git branch -D &lt;UUSHARU&gt;</code> kustutab jõuga</li><li><code>git push origin --delete &lt;UUSHARU&gt;</code> ehk, et kustuta vastava nimeline remote oks</li><li>Fetch <a href="https://www.atlassian.com/git/tutorials/syncing/git-fetch" target="_blank" rel="noopener noreferrer">https://www.atlassian.com/git/tutorials/syncing/git-fetch</a></li><li><a href="https://www.git-tower.com/learn/git/faq/difference-between-git-fetch-git-pull/" target="_blank" rel="noopener noreferrer">https://www.git-tower.com/learn/git/faq/difference-between-git-fetch-git-pull/</a></li></ul><p>Alusta tööd alati <code>git status</code> käsuga, siis, vajadusel või ka igaks juhuks <code>pull</code> käsuga, et sikutada remotest vajalik alla.<br> Kui ei saa, siis:<br><code>git fetch --all</code><br> Kui ikka ei saa, siis:<br><code>git checkout -b backup-master</code><br> Ja seejärel:<br><code>git reset --hard origin/&lt;SIIAVAJALIKUBRANCHINIMI&gt;</code><br> See viimane paneb vägisi peale remote&#39;is oleva sisu</p><h3 id="juhend-oma-arvutist-giti-tegemiseks"><a class="header-anchor" href="#juhend-oma-arvutist-giti-tegemiseks" aria-hidden="true">#</a> Juhend oma arvutist giti tegemiseks</h3><p>Kõigepealt tee oma arvutis git init.<br> Siis <code>git add .</code> , et lisada kõik vajalik.<br> Vajadusel ka .gitignore<br> Siis <code>git commit -m &quot;siia kommentaar&quot;</code></p><p><strong>Siis mine github&#39;i ja</strong></p><ul><li>New</li><li>Create</li><li>Push an existing repository... ja järgi juhiseid</li></ul><p>Mergemisega aga: Kui soovid kaht oksa ühendada, siis mine sinna, kuhu teise tahad tõmmata ja <code>git merge UUSHARU</code>. Kui on erinevused, siis ta pakub võimaluse ümber kirjutada või asendada teisega emma, kumma või lisada mõlemad.</p><p>Seejärel tee commit.<br> Kui mingil põhjusel ei saa, võid katkestada: <code>git merge --abort</code></p><p>Ühtlusta oksad nii lokaalselt kui eemaolevast: <a href="https://www.freecodecamp.org/news/how-to-delete-a-git-branch-both-locally-and-remotely/" target="_blank" rel="noopener noreferrer">https://www.freecodecamp.org/news/how-to-delete-a-git-branch-both-locally-and-remotely/</a></p><p>Kui teha uus oks ja siis commitada ja pushida, tekib nii:</p><p>❯ git push fatal: The current branch uusoks has no upstream branch. To push the current branch and set the remote as upstream, use</p><pre><code>git push --set-upstream origin uusoks\n</code></pre>',21);r.render=function(i,a,r,s,l,d){return e(),t("div",null,[o])};export default r;export{a as __pageData};
